import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState([]);
  const [commissionOpen, setCommissionOpen] = useState(true);
  const [violationsOpen, setViolationsOpen] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData) return <div>Loading...</div>;

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif", backgroundColor: "#f9f9f9", minHeight: "100vh" }}>
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h1>Agent Dashboard</h1>
        <button onClick={handleLogout} style={{ padding: "5px 10px", backgroundColor: "#d32f2f", color: "#fff", border: "none", borderRadius: "3px", cursor: "pointer" }}>Logout</button>
      </div>

      {/* Weekly Commission Collapsible */}
      <div style={{ marginTop: "20px", border: "1px solid #ddd", borderRadius: "5px", backgroundColor: "#fff" }}>
        <div onClick={() => setCommissionOpen(!commissionOpen)} style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", cursor: "pointer", fontWeight: "bold" }}>
          {commissionOpen ? "▼" : "▶"} Weekly Commission
        </div>
        {commissionOpen && commissionData && (
          <table style={{ width: "100%", borderCollapse: "collapse" }}>
            <thead>
              <tr>
                <th style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "8px", textAlign: "left" }}>Field</th>
                <th style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "8px", textAlign: "left" }}>Value</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(commissionData).map(([key, value]) => (
                <tr key={key}>
                  <td style={{ borderBottom: "1px solid #ddd", padding: "8px" }}>{key}</td>
                  <td style={{ borderBottom: "1px solid #ddd", padding: "8px" }}>{value || "N/A"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>

      {/* Violations Collapsible */}
      <div style={{ marginTop: "20px", border: "1px solid #ddd", borderRadius: "5px", backgroundColor: "#fff" }}>
        <div onClick={() => setViolationsOpen(!violationsOpen)} style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", cursor: "pointer", fontWeight: "bold" }}>
          {violationsOpen ? "▼" : "▶"} Scanning Violations & ARs ({violationsData.length})
        </div>
        {violationsOpen && violationsData.length > 0 ? (
          <table style={{ width: "100%", borderCollapse: "collapse" }}>
            <thead>
              <tr>
                {Object.keys(violationsData[0]).map((header) => (
                  <th key={header} style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "8px", textAlign: "left" }}>
                    {header}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {violationsData.map((row, index) => (
                <tr key={index}>
                  {Object.values(row).map((value, i) => (
                    <td key={i} style={{ borderBottom: "1px solid #ddd", padding: "8px" }}>
                      {value || "N/A"}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        ) : violationsOpen && <p style={{ padding: "10px" }}>No violations found.</p>}
      </div>
    </div>
  );
}

export default Dashboard;
